import React from "react";
import "./module.css";

const Subjects = () => {
  const assignments = [
    "New Assignment: Group Activity 1.docx",
    "New Assignment: Group Activity 2.docx",
    "New Assignment: Group Activity 3.docx",
    "New Assignment: Group Activity 4.docx",
    "New Assignment: Group Activity 5.docx",
    "New Assignment: Group Activity 6.docx",
    "New Assignment: Group Activity 7.docx",
  ];

  const lessons = [
    "Chapter 1.pdf",
    "Chapter 2 RRL/HRS.pdf",
    "Chapter 3 Theoretical Frameworks.pdf",
    "Chapter 4 METHODOLOGY.pdf",
  ];

  return (
    <div className="subjects-container">
      <aside className="sidebar">
        <h2>Menu</h2>
        <ul>
          {[
            "Home",
            "Announcements",
            "Discussions",
            "Grades",
            "People",
            "Files",
            "Syllabus",
            "Modules",
          ].map((item) => (
            <li key={item}>{item}</li>
          ))}
        </ul>
      </aside>

      <main className="main-content">

        <section className="section">
          <h2>Assignments</h2>
          <div className="item-list">
            {assignments.map((assignment, index) => (
              <div key={index} className="item">
                {assignment}
              </div>
            ))}
          </div>
        </section>

        <section className="section">
          <h2>Lessons</h2>
          <div className="item-list">
            {lessons.map((lesson, index) => (
              <div key={index} className="item">
                {lesson}
              </div>
            ))}
          </div>
        </section>
      </main>

      <aside className="right-panel">
        {[
          "View Course Stream",
          "Drop the Course",
          "View Course Calendar",
          "View Course Notification",
        ].map((btn, index) => (
          <button key={index} className="right-button">
            {btn}
          </button>
        ))}
      </aside>
    </div>
  );
};

export default Subjects;
